import React, {useState,useEffect} from 'react';
import axios from 'axios';

function List(){
    const[data,setData] = useState();
    const getData = async () => {
      let reponse = await axios.get('http://localhost:8080/get')
      .then((Response)=>{
        console.log(Response.data)
      })
      .catch((Error) =>{
        console.log(Error);
      })
    }
  
    useEffect(()=>{
      getData();
    },[]);
    return(
        <div>
            {data.map((a,i)=>{
                console.log(a)
            })}
        </div>
    )
}

export default List;
